@DarkCorners3 PRIMAL RAGE (2018)

A Bigfoot-Predator hybrid with a kinky fetish for blonde women makes a sport of tearing apart rednecks in this high body count creature feature. 

Old-school practical effects, likeable characters and a simple but well executed plot made this a fun watch! https://t.co/4M3zVq8Jk9
